import React from "react";
import Spacer from "./Spacer";
import {
    ArgumentAxis,
    ValueAxis,
    Chart,
    LineSeries,
} from "@devexpress/dx-react-chart-material-ui";
const data = [
    { argument: 1, value: 10 },
    { argument: 2, value: 20 },
    { argument: 3, value: 30 },
];
const StatsCharts = () => {
    return (
        <Spacer variant="vertical">
            <Chart data={data}>
                <ArgumentAxis />
                <ValueAxis />
                <LineSeries valueField="value" argumentField="argument" />
            </Chart>
        </Spacer>
    );
};

export default StatsCharts;
